#preloader-inner {
    position: absolute;
    width: 100%;
    height: 100%
}

#preloader-center {
    width: 250px;
    height: 220px;
    position: absolute;
    top: 50%;
    left: 50%;

}

#play {
    position: absolute;
    left: 0;
    top: 15px;
    animation-name: play-pulse;
    animation-duration: .7s;
    animation-iteration-count: infinite;
    animation-timing-function: ease-in-out
}

#gear {
    position: absolute;
    left: 45px;
    animation-name: gear-turn;
    animation-duration: 2.66s;
    animation-iteration-count: infinite;
    animation-timing-function: linear
}

#pf-title {
    max-width: 30%;
    max-height: 8%;
    position: absolute;
    bottom: 1vh;
    right: 0;
    left: 0;
    margin: auto
}

@keyframes gear-turn {
    from {
        transform: rotate(0)
    }
    to {
        transform: rotate(360deg)
    }
}

@keyframes play-pulse {
    0% {
        transform: scale(1)
    }
    14% {
        transform: scale(.9)
    }
    28% {
        transform: scale(1)
    }
    100% {
        transform: scale(1)
    }

        var gears = document.getElementById("preloader-center");
        if (!gears) return;

        function scaleGears() {
            gears.style.display = "block";
            var w = window.innerWidth;
            var h = window.innerHeight;
            var dimensions;
            if (window.dapi && window.dapi.getScreenSize) {
                dimensions = window.dapi.getScreenSize();
            } else if (window.mraid && window.mraid.getMaxSize) {
                dimensions = window.mraid.getMaxSize();
            }
            if (dimensions) {
                w = dimensions.width || w;
                h = dimensions.height || h;
            }

            var scale = Math.min((w * 0.45) / 250, (h * 0.3) / 220, 1);
            // var scale = 0.3;
            gears.style.transform =
                "translate(-50%, -50%) scale(" + scale + ")";
        }

        window.addEventListener("resize", scaleGears);
        setTimeout(scaleGears, 500);
        setTimeout(scaleGears, 1000);

        const pfPreloaderDiv = document.getElementById("preloader-pf");
        const observers = [];
        const disconnectObservers = () => {
            for (const ob of observers) {
                ob.disconnect();
            }
            observers.length = 0;
        };
        (() => {
            const observer = new MutationObserver((mutations, observer) => {
                for (const m of mutations) {
                    if (m.type === "childList") {
                        const preloaderDiv = (() => {
                            for (const node of m.removedNodes) {
                                if (node.id === "preloader") {
                                    return node;
                                }
                            }
                        })();

                        if (preloaderDiv) {
                            pfPreloaderDiv.classList.add("hide");
                            setTimeout(() => pfPreloaderDiv.remove(), 500);
                            disconnectObservers();
                        }
                    }
                }
            });
            const config = { childList: true };
            observer.observe(document.body, config);
            observers.push(observer);
        })();
        /* watch for preloader class change */
        (() => {
            const observer = new MutationObserver((mutations, observer) => {
                for (const m of mutations) {
                    if (m.type === "attributes") {
                        const effectiveStyle = window.getComputedStyle(
                            m.target
                        );

                        if (
                            effectiveStyle.getPropertyValue("display") ===
                                "none" ||
                            effectiveStyle.getPropertyValue("visibility") ===
                                "hidden"
                        ) {
                            pfPreloaderDiv.classList.add("hide");
                            setTimeout(() => pfPreloaderDiv.remove(), 500);
                            disconnectObservers();
                        }
                    }

            });

                attributes: true,
                attributeFilter: ["class"],
            };
